import axios from "axios";

export const helloWorldReq = () => axios.get('http://localhost:8080/hello-world')
export const helloWorlBeandReq = () => axios.get('http://localhost:8080/hello-world-bean')
export const helloWorldPathVariableReq = (username) => axios.get(`http://localhost:8080/hello-world/path-variable/${username}`)
